import React from 'react'

import Banner from '../Information/components/Banner'

import '../../Global/Banner.css';

const Information = () => {
  return (
    <>
    <div className='Info-wrap'>
      <div className='Info-flex'>
        <div className='Info-Banner'>

        </div>
      </div>
    </div>
    </>
  )
}

export default Information
